  false,\n\t\"url\": null,\n\t\"notes\": \"Earth Eye collected LiDAR data for approximately
  1,703 square kilometers that partially cover the Connecticut counties of Litchfield
  and Fairfield. The nominal pulse spacing for this project was no greater than 1
  point every 0.7 meters. Dewberry used proprietary procedures to classify the LAS
  according to project specifications: 1-Unclassified, 2-Ground, 7-Noise, 9-Water,
  12-Overlap. Dewberry produced 3D breaklines and combined these with the final LiDAR
  data to produce seamless hydro flattened DEMs for the 1,742 tiles (1000 m x 1000
  m) that cover the project area.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
